import Home from './Home-Screen/home.js'
import AboutMe from './AboutMe-page/AboutMe.js'
import Lang from './Languages-page/Languages';

function App() {
  return (
    <div className="container">
      <Home/>
      <AboutMe />
      <Lang/>
    </div>
  );
}

export default App;
